// dataTransforms.js
import _ from "lodash";

// 共用的工具函數
const parseCurrencyValue = (value) => {
  return parseFloat(value.replace("$", "")) || 0;
};

const calculateRate = (numerator, denominator, decimals = 2) => {
  return denominator > 0
    ? ((numerator / denominator) * 100).toFixed(decimals)
    : null;
};

const getDateKey = (dateStr, timeGranularity) => {
  const date = new Date(dateStr);

  switch (timeGranularity) {
    case "hour":
      return `${date.getFullYear()}-${String(date.getMonth() + 1).padStart(
        2,
        "0"
      )}-${String(date.getDate()).padStart(2, "0")} ${String(
        date.getHours()
      ).padStart(2, "0")}:00`;
    case "week":
      const weekStart = new Date(date);
      weekStart.setDate(date.getDate() - date.getDay());
      return weekStart.toISOString().split("T")[0];
    case "month":
      return `${date.getFullYear()}-${String(date.getMonth() + 1).padStart(
        2,
        "0"
      )}`;
    default: // day
      return date.toISOString().split("T")[0];
  }
};

const findBestPerformers = (stats) => {
  return {
    highestROAS: _.maxBy(stats, "ROAS"),
    lowestACOS: _.minBy(
      stats.filter((c) => parseFloat(c.ACOS) > 0),
      "ACOS"
    ),
    highestCTR: _.maxBy(stats, (c) => parseFloat(c.CTR)),
    highestConversion: _.maxBy(stats, (c) => parseFloat(c.conversionRate)),
  };
};

// 主要的導出函數
export const processCampaignData = (data) => {
  if (!Array.isArray(data)) {
    console.error("Input data is not an array");
    return { stats: [], best: null };
  }

  const stats = _(data)
    .groupBy("Campaign Name")
    .map((campaign, name) => {
      const totalImpressions = _.sumBy(campaign, "Impressions");
      const totalClicks = _.sumBy(campaign, "Clicks");
      const totalOrders = _.sumBy(campaign, "7 Day Total Orders (#)");
      const totalSpend = _.sumBy(campaign, (row) =>
        parseCurrencyValue(row["Spend"])
      );
      const totalSales = _.sumBy(campaign, (row) =>
        parseCurrencyValue(row["7 Day Total Sales "])
      );

      return {
        name,
        impressions: totalImpressions,
        clicks: totalClicks,
        orders: totalOrders,
        spend: totalSpend,
        sales: totalSales,
        CTR: calculateRate(totalClicks, totalImpressions),
        CPC: totalClicks ? (totalSpend / totalClicks).toFixed(2) : 0,
        ACOS: calculateRate(totalSpend, totalSales),
        ROAS: totalSpend ? (totalSales / totalSpend).toFixed(2) : 0,
        conversionRate: calculateRate(totalOrders, totalClicks),
      };
    })
    .value();

  return {
    stats,
    best: findBestPerformers(stats),
  };
};

// 添加時間格式化函數
const formatDateTime = (date, hour) => {
  // 確保 hour 是字符串且至少兩位數
  const paddedHour = String(hour || "00").padStart(2, "0");
  return `${date} ${paddedHour}:00:00`;
};

export const processTrendData = (
  data,
  timeGranularity = "day",
  compareMode = "combined"
) => {
  if (!Array.isArray(data)) {
    console.error("Input data is not an array");
    return [];
  }

  return _(data)
    .groupBy((row) => {
      if (timeGranularity === "hour") {
        // 使用 Start Date 和 Hour 組合作為分組依據
        return formatDateTime(row["Start Date"], row["Hour"]);
      }

      const date = new Date(row["Start Date"]);
      switch (timeGranularity) {
        case "week":
          const weekStart = new Date(date);
          weekStart.setDate(date.getDate() - date.getDay());
          return weekStart.toISOString().split("T")[0];
        case "month":
          return `${date.getFullYear()}-${String(date.getMonth() + 1).padStart(
            2,
            "0"
          )}`;
        default: // day
          return row["Start Date"];
      }
    })
    .map((group, dateTime) => {
      // 計算該時間點的總計數據
      const totalSales = _.sumBy(group, (row) =>
        parseCurrencyValue(row["7 Day Total Sales "])
      );
      const totalSpend = _.sumBy(group, (row) =>
        parseCurrencyValue(row["Spend"])
      );

      const result = {
        date: dateTime,
        sales: totalSales,
        spend: totalSpend,
        ACOS:
          totalSales > 0 ? ((totalSpend / totalSales) * 100).toFixed(2) : null,
      };

      // 如果是分開比較模式，添加各活動的數據
      if (compareMode === "separate") {
        result.campaignData = _(group)
          .groupBy("Campaign Name")
          .mapValues((campaignGroup) => ({
            sales: _.sumBy(campaignGroup, (row) =>
              parseCurrencyValue(row["7 Day Total Sales "])
            ),
            spend: _.sumBy(campaignGroup, (row) =>
              parseCurrencyValue(row["Spend"])
            ),
          }))
          .value();
      }

      return result;
    })
    .orderBy(["date"], ["asc"])
    .value();
};
